import React from "react";
import Sort from "./Sort";
import Sequence from "./Sequence";
import TabBlockStyled from "./styled/TabBlockStyled";

const TabBlock = () => {
  return (
    <TabBlockStyled>
      <Wrapper>
        <Sequence />

        <Sort />
      </Wrapper>
    </TabBlockStyled>
  );
};

export default TabBlock;
